CREATE TABLE public.certificado (
    id                    BIGSERIAL PRIMARY KEY,
    protocolo_certificado varchar(100) NOT NULL,
    id_embarcacao         BIGINT,
    data_validade         date         NOT NULL,
    data_hora             timestamp,
    tipo_certificacao     varchar(100) NOT NULL,
    FOREIGN KEY (id_embarcacao) REFERENCES embarcacao (id)
);

CREATE TABLE public.embarcacao_tr_temp (
    id            BIGSERIAL PRIMARY KEY,
    cpf           varchar(100),
    id_embarcacao BIGINT,
    FOREIGN KEY (id_embarcacao) REFERENCES embarcacao (id)
);



